        //调用地图模板
        var tileLayer = new G.Layer.Tile('https://{s}.geohey.com/s/mapping/light/all?z={z}&x={x}&y={y}&retina={i}&ak=ODVhNzJjOTQ4ODJiNDlhNGEwNGE0MGRkYzM4MzA3ODU', {
            cluster: ['s1', 's2', 's3', 's4', 's5', 's6', 's7', 's8']
        });
        tileLayer.addTo(map);

        //将图层添加到Map中
        var graphicLayer = new G.Layer.Graphic();
        graphicLayer.addTo(map);

        var circleLayer = new G.Layer.Graphic();
        circleLayer.addTo(map);

        var lineLayer = new G.Layer.Graphic();
        lineLayer.addTo(map);

        var imgLayer = new G.Layer.Graphic();
        imgLayer.addTo(map);

        var textLayer = new G.Layer.Graphic();
        textLayer.addTo(map);



        //取数据
        var array = [];
        var itemName = [];
        for (var i = 0; i < sData.CityMap_Dimension.length; i++) {
            if (sData.CityMap_Dimension[i].sType == '区县' && sData.CityMap_Dimension[i].sPoints != '') {
                var arr = sData.CityMap_Dimension[i].sPoints.split("|");
                var itemArr = [];
                // var itemName = [];
                itemName.push(sData.CityMap_Dimension[i].sName);
                // console.log(itemName);
                // console.log(arr)
                for (var j = 0; j < arr.length; j++) {
                    var arr1 = arr[j].split(",");
                    //北京坐标转化为web墨卡托坐标然后加入到数组中
                    itemArr.push(G.Proj.WebMercator.project(parseFloat(arr1[0]), //经度
                        parseFloat(arr1[1]))); //纬度
                }
                array.push(itemArr);
                // console.log(itemArr)
            }
        }
        // console.log(itemName)
        //添加多面
        addArea = function(array) {
            var g = new G.Graphic.MultiPolygon({ "m": [array] },
                null, {
                    fillColor: 'rgba(105,241,214,0.5)', //填充色
                    // fillOpacity: 0.5, //填充透明度
                    outlineColor: 'rgb(9,95,78)', // 边框线颜色
                });
            //将多面添加到图层
            g.addTo(graphicLayer);
        }
        addArea(array);

        //图层添加中心文字
        addText = function(centerPort) {
            var g = new G.Graphic.Point(centerPort, null, {
                shape: 'text', //文字类型标识
                size: [16], // 字体大小
                offset: [5, 10], // 偏移量
                text: itemName[i], //文字名称
                fillColor: 'rgb(3, 29, 54)', //填充色
                // clickable: true //可点击的标识
            });
            //console.log(itemName)
            g.addTo(textLayer);
        }

        //图层添加图标
        addImg = function(centerPort) {
            var g = new G.Graphic.Point(centerPort, null, {
                shape: 'image',
                size: [16, 20], // 图片大小
                offset: [-5, -10], // 偏移量
                image: 'http://js.soufunimg.com/industry/citymap/images/mark-label.ico'
                // clickable: true //可点击的标识
            });
            g.addTo(imgLayer);
        }

        //图层添加圆圈
        addCircle = function(centerPort) {
            var g = new G.Graphic.Point(centerPort, null, {
                shape: 'circle',
                size: [150], // 字体大小
                offset: [0, 0], // 偏移量
                fillColor: 'rgba(255, 255, 255, 0.1)',
                outline: true,
                outlineColor: 'rgb(223,172,80)',
                // clickable: true //可点击的标识
            });
            g.addTo(circleLayer);
        }

        //图层添加连线
        addLine = function(targetPoint, centerPort) {
            var g = new G.Graphic.Polyline([targetPoint, centerPort], null, {
                lineWidth: 5,
                lineColor: 'aqua'
            });
            g.addTo(lineLayer);
        }

        //目标点
        var targetPoint = G.Proj.WebMercator.project(121.621331, 38.919666);
        for (var i = 0; i < array.length; i++) {
            var centerPort = G.GeomUtil.centroid(array[i]);
            addText(centerPort);
            addCircle(centerPort);
            addImg(centerPort);
            addLine(targetPoint, centerPort);
        }
        
        $("#hideGraphic").bind("click", function() {
            circleLayer.clear();
            imgLayer.clear();
            lineLayer.clear();
        })
     
        $("#showCircle").bind("click", function() {
            if($("#showCircle").val() == "显示圆圈"){
                $("#showCircle").val("隐藏圆圈");
                for (var i = 0; i < array.length; i++) {
                    var centerPort = G.GeomUtil.centroid(array[i]);
                   addCircle(centerPort);
                }
            } else {
                $("#showCircle").val("显示圆圈");
                circleLayer.clear();
            }

        })

        $("#showLine").bind("click", function() {
            if($("#showLine").val() == "显示连线"){
                $("#showLine").val("隐藏连线");
                for (var i = 0; i < array.length; i++) {
                    var centerPort = G.GeomUtil.centroid(array[i]);
                    addLine(targetPoint, centerPort);
                }
            } else {
                $("#showLine").val("显示连线");
                lineLayer.clear();
            }
        })

        $("#showImg").bind("click", function() {
            // console.log($("#showImg").val())
            if($("#showImg").val() == "显示标记"){
                $("#showImg").val("隐藏标记");
                for (var i = 0; i < array.length; i++) {
                    var centerPort = G.GeomUtil.centroid(array[i]);
                    addImg(centerPort);
                }
            } else {

                $("#showImg").val("显示标记");
                imgLayer.clear();
            }
        })
        

        
    });
    </script>
</body>

</html>
